const POPULATE = "produce/POPULATE"
import produceData from '../mockData/produce.json';


export default function produceReducer(state = {}, action) {
    switch (action.type) {

        default:
            return state;

    }
}

export function populateProduce() {

    return {
       type: POPULATE,
       produce: produceData
    }

}
